import React from "react";

function showTask(task) {
  return (
    <div>
      {Object.keys(task).map((key, index) => {
        return (
          <div key={key + index}>
            {task} : {task[key]}
          </div>
        );
      })}
    </div>
  );
}

function Task({ index, task }) {
  console.log("Task", index, task.name);
  return (
    <div>
      <h1>Task</h1>
      {Object.keys(task).map((key, index) => {
        return showTask(task[key], index);
      })}
    </div>
  );
}

export default Task;
